import React from 'react';
import css from './Button.module.css';

const Button = props => {
    return (
        <>
            <div className={css.buttons}>
                <button onClick={props.onClickButton}>{props.buttonsTitle}</button>
            </div>
        </>
    );
};

export default Button;
